    function gradeFormatter(value, row, index) {
        var str = '';
        var fig = {
            "MAX": '<img src=data:image/png;base64,\>',
            "MAX-": '<img src=data:image/png;base64,\>',
            "AAA": '<img src=data:image/png;base64,\>',
            "AA": '<img src=data:image/png;base64,\>',
            "A": '<img src=data:image/png;base64,\>',
            "B": '<img src=data:image/png;base64,\>',
            "C": '<img src=data:image/png;base64,\>',
            "D": '<img src=data:image/png;base64,\>',
            "E": '<img src=data:image/png;base64,\>',
            "F": '<img src=data:image/png;base64,\>'
        }
        gradep = row.ex_score / (row.notes * 2)
        if (gradep == 1) {
            str = fig['MAX']
        } else if (gradep >= 8 / 9) {
            str = fig['AAA'];
        } else if (gradep >= 7 / 9) {
            str = fig['AA'];
        } else if (gradep >= 6 / 9) {
            str = fig['A'];
        } else if (gradep >= 5 / 9) {
            str = fig['B'];
        } else if (gradep >= 4 / 9) {
            str = fig['C'];
        } else if (gradep >= 3 / 9) {
            str = fig['D'];
        } else if (gradep >= 2 / 9) {
            str = fig['E'];
        } else {
            str = fig['F'];
        }
        return str;
    }
